import axios from "axios";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./practice.css";

const ShowPosts = () => {
  const [Posts, setPosts] = useState([]);

  const fetchPosts = async () => {
    const result = await axios.get("http://localhost:8000/api/");

    console.log(result.data);
    setPosts(result.data);
  };

  useEffect(() => {
    fetchPosts();
  }, []);

  const goToDetail = () => {
    alert("detail page");
  };

  return (
    <div className="container">
      <div className="posts-table">
        <div className="table-head">
          <div className="subjects">Posts</div>
          <div className="replies">Replies/Views</div>
          <div className="last-reply">Last Reply</div>
        </div>
        {Posts.map((Post, index) => (
          <div>
            <div className="table-row">
              <Link to={`/${Post.id}`} className="subjects">
                <div>
                  <img src={Post.image} height="150" width="250" />
                </div>
                <div>
                  <div>{Post.title}</div>
                  <p>{Post.description}</p>
                </div>
              </Link>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};
export default ShowPosts;
